"243477":{"id":"243477","name":"Bola Rolando: Major League Soccer","slug":"bola-rolando-major-league-soccer","original_title":"Onside: Major League Soccer","overview":"Vá além das quatro linhas com acesso exclusivo aos jogadores e personalidades que movem a MLS. Momentos eletrizantes e histórias cativantes fizeram de 2024 uma temporada inesquecível, e nos deram uma ideia do que está por vir.","first_air_date":"2025-02-20","episode_run_time":0,"vote_average":0,"number_of_seasons":1,"number_of_episodes":8,"created_by":[],"production_companies":["Box to Box Films","Major League Soccer"],"genres":["Documentário","Reality"],"certification":"12","backdrop_path":"https://image.tmdb.org/t/p/original/q3xnos3EajMKnMEojjBz6VMWMll.jpg","poster_path":"https://image.tmdb.org/t/p/original/1M2Y3IRAzQAGrEG5OWzqLz36OCC.jpg","cast":[],"trailer":"HnCcJ0o7FAg","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/1M2Y3IRAzQAGrEG5OWzqLz36OCC.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/1M2Y3IRAzQAGrEG5OWzqLz36OCC.jpg","air_date":"2025-02-20","episode_count":8,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"DE VOLTA À GLÓRIA","overview":"Em meio à febre Messi, Miami e LA Galaxy se preparam para um grande desafio no início da temporada. Riqui Puig fala sobre a pressão de corresponder às expectativas de ser uma estrela.","air_date":"2025-02-20","runtime":42,"still_path":"https://image.tmdb.org/t/p/original/ex0nD8j9KRW6mmcXIS7Hv1wY4q5.jpg","vote_average":0},"2":{"name":"O INFERNO EXISTE","overview":"A rivalidade intensa de Ohio está de volta. Com o jogo se aproximando, craques e técnicos discutem o que está em jogo, a vontade de vencer e a entrega em campo.","air_date":"2025-02-20","runtime":40,"still_path":"https://image.tmdb.org/t/p/original/9ZxWmNzTXYTyhpaqkFyKyvExHZS.jpg","vote_average":0},"3":{"name":"Sangue Novo","overview":"Cavan Sullivan assina com o Philly aos 14 anos. Começa a contagem regressiva para o fenômeno da base estrear como o jogador mais jovem da história da MLS.","air_date":"2025-02-20","runtime":37,"still_path":"https://image.tmdb.org/t/p/original/qPFLuOx7DXTi5vmctIDMlL8GbB6.jpg","vote_average":0},"4":{"name":"FASE RUIM","overview":"No segundo ano na liga, o St. Louis CITY enfrenta a pressão de estabelecer uma mentalidade vencedora. Uma revanche contra o arquirrival Sporting KC promete aumentar ainda mais a tensão.","air_date":"2025-02-20","runtime":42,"still_path":"https://image.tmdb.org/t/p/original/7KrB7jj5Onut3spbJwwDE0hSs6d.jpg","vote_average":0},"5":{"name":"REIS DE NOVA YORK","overview":"Quem domina Nova York? Uma resposta será dada no primeiro clássico do Rio Hudson no mata-mata. A jovem estrela do RBNY, John Tolkin, sente o peso dos holofotes.","air_date":"2025-02-20","runtime":34,"still_path":"https://image.tmdb.org/t/p/original/2XVxrKHoucGUt8FENxlCJops0iG.jpg","vote_average":0},"6":{"name":"A JANELA","overview":"Os clubes saem à caça de novos talentos na janela de transferências de verão, em um mês frenético de negociações fechadas, ou fracassadas, e a chegada de novas estrelas.","air_date":"2025-02-20","runtime":36,"still_path":"https://image.tmdb.org/t/p/original/apdVUPCErPpODMnMtIeN3Ogzic3.jpg","vote_average":0},"7":{"name":"A GRANDE DECISÃO","overview":"A longa jornada do Atlanta United de volta à disputa pelo título chega ao ponto crucial. Um milagre no Dia de Decisão garante o duelo da primeira rodada contra o Inter Miami de Messi.","air_date":"2025-02-20","runtime":46,"still_path":"https://image.tmdb.org/t/p/original/rhzEHvXUlq71l2BTHATxYdF1DED.jpg","vote_average":0},"8":{"name":"LEGADO","overview":"Sem Messi na disputa, qualquer um pode levar o título da MLS. A lesão de Riqui Puig abala o LA Galaxy, que se prepara para enfrentar o New York Red Bulls na final.","air_date":"2025-02-20","runtime":38,"still_path":"https://image.tmdb.org/t/p/original/qbH92UAOVBROUwFaxKfZfe2vLX5.jpg","vote_average":0}}}}},
