"201285":{"id":"201285","name":"Light & Magic","slug":"light-magic","original_title":"Light & Magic","overview":"Quando George Lucas decidiu fazer Star Wars, mal sabia ele que acabaria revolucionando uma indústria. Esta série mostra a evolução da Industrial Light & Magic, a empresa responsável pelos efeitos visuais icônicos de Star Wars, E.T., Exterminador 2, Jurassic Park e tantos outros filmes. Esta é a história de uma equipe de gênios criativos que colocam a magia nos filmes que amamos.","first_air_date":"2022-07-27","episode_run_time":60,"vote_average":7.6,"number_of_seasons":1,"number_of_episodes":6,"created_by":[],"production_companies":["Lucasfilm Ltd.","Imagine Documentaries"],"genres":["Documentário"],"certification":"12","backdrop_path":"https://image.tmdb.org/t/p/original/wFRY4qnUbJrq3GL0glmOdkkwJbJ.jpg","poster_path":"https://image.tmdb.org/t/p/original/91yE4Uo1ZthoLyek6V4uF5crXmy.jpg","cast":["George Lucas","Dennis Muren","Lorne Peterson","Ron Howard","Steven Spielberg"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/cO3nczmIHxd54sLTAEs15QJJXWW.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/cO3nczmIHxd54sLTAEs15QJJXWW.jpg","air_date":"2022-07-27","episode_count":6,"overview":"N/A","vote_average":4.7,"episodes":{"1":{"name":"Turma de Renegados","overview":"O ano é 1975, e George Lucas tem um problema. Não há nenhuma empresa de efeitos visuais em Hollywood capaz de realizar a enorme visão por trás de seu filme “Star Wars”. George e o especialista em câmeras John Dykstra montam uma equipe de artistas sonhadores para o trabalho, mas apesar de seus melhores esforços e novas tecnologias formidáveis, a equipe da ILM fica lamentavelmente para trás.","air_date":"2022-07-27","runtime":59,"still_path":"https://image.tmdb.org/t/p/original/fiT1YWKK4j6qaPgooidDbgobzap.jpg","vote_average":4.7},"2":{"name":"Em um Cavalo Indomável","overview":"Quando um acidente frustra seu sonho de infância de pilotar carros, George Lucas encontra sucesso como cineasta. Ele gasta seu próprio dinheiro nos efeitos especiais de uma nova “ópera espacial”, mas o progresso é lento. Com a ajuda de novas contratações, a ILM se reúne para terminar o filme a tempo. Star Wars estreia com sucesso mundial, mas George continua insatisfeito com os resultados.","air_date":"2022-07-27","runtime":53,"still_path":"https://image.tmdb.org/t/p/original/9NgE2yVbQIgmqFm9EywNW4Fuq5d.jpg","vote_average":4.7},"3":{"name":"Apenas Pense a Respeito","overview":"Depois de Star Wars, a ILM se muda para o norte, mas nem todos são convidados. À medida que o trabalho começa em O Império Contra-Ataca, a equipe enfrenta desafios. Frustrado com as ferramentas disponíveis, George cria uma nova divisão para ajudar a modernizar o cinema. Após o lançamento do novo filme, a ILM assume um trabalho externo, preparando o terreno para uma notável sequência de sucessos.","air_date":"2022-07-27","runtime":63,"still_path":"https://image.tmdb.org/t/p/original/60U2CG6ZwGWNpgxmAvxeQcWRyag.jpg","vote_average":4.7},"4":{"name":"Acho que encontrei meu pessoal","overview":"Uma parceria com Steven Spielberg resulta nos efeitos memoráveis de Caçadores da Arca Perdida, E.T.. Enquanto isso, o grupo de computação gráfica marca seu primeiro avanço digital. À medida que a era dos Blockbusters chega, as equipes da ILM estão competindo, tanto por recursos quanto por prêmios. George toma uma fatídica decisão de negócios, e a ILM é forçada a se reconstruir rapidamente.","air_date":"2022-07-27","runtime":63,"still_path":"https://image.tmdb.org/t/p/original/43eg7D1jNd64aBUPYB1jkiuW3yn.jpg","vote_average":4.7},"5":{"name":"Transformação.","overview":"A ILM entra na era digital quando a sua divisão de computadores enfrenta o primeiro grande teste com Willow. Com uma nova equipe de rebeldes ansiosa para levar a CG ao limite, James Cameron dá a eles uma chance com O Segredo do Abismo e Exterminador 2. Mas a transição para o digital não ocorre sem baixas, já que alguns lutam para se adaptar. Então Steven Spielberg retorna com seu maior desafio.","air_date":"2022-07-27","runtime":54,"still_path":"https://image.tmdb.org/t/p/original/1lCWqg82YK7QfyJm5lrtm7xwgKs.jpg","vote_average":4.7},"6":{"name":"Chega de Fingir que são Dinossauros","overview":"Phil Tippett sente que foi extinto quando o CG inesperadamente toma o centro do palco em Jurassic Park. O momento decisivo convence George Lucas a retornar à sua trilogia prequela de Star Wars há muito planejada e levar a tecnologia ainda mais longe. À medida que o cinema digital continua a crescer e evoluir, \"O Volume\" prova que o espírito de inovação permanece vivo e bem na ILM.","air_date":"2022-07-27","runtime":63,"still_path":"https://image.tmdb.org/t/p/original/tRj8ymYzeIEXfC5VrXsYx6H1uHg.jpg","vote_average":4.7}}}}},
